import { useState } from "react";

interface Props {
  state: boolean;
  handleState: (state: boolean) => void;
}
function SideNav(props: Props) {

  function handleSideNav() {
    props.handleState(!props.state);
  }

  return (
    <div className="SideNav absolute">
      <nav
        style={{ width: !props.state ? "56px" : "300px", paddingLeft: !props.state ? 0 : 30, alignItems: !props.state ? "center": "start" }}
        className={`h-screen bg-yellow-100 flex flex-col justify-between items-start py-10`}
      >
        <div className="flex flex-col items-center text-black">
          <a href="#" className="flex items-center">
            <span className="material-symbols-rounded ">home</span>
            <p className={!props.state ? "hidden": "inline"}>Home</p>
          </a>
          <a href="#" className="mt-10 flex items-baseline">
            <span className="material-symbols-rounded">monitoring</span>
            <p className={!props.state ? "hidden": "inline"}>Home</p>
          </a>
          <a href="#" className="mt-10 flex items-center">
            <span className="material-symbols-rounded">leaderboard</span>
            <p className={!props.state ? "hidden": "inline"}>Home</p>
          </a>
        </div>
        <div>
          <a onClick={handleSideNav}>
            <span className="material-symbols-rounded text-3xl">
              exit_to_app
            </span>
          </a>
        </div>
      </nav>
    </div>
  );
}

export default SideNav;
